import React from "react";
import "./Banner.css";
export default function Header() {
  return (
    <div className="header">
      <img
        className="headerImg"
        src="https://64.media.tumblr.com/6aa61e17a4b0e735f8c7d23ada56bf44/0b0793654ab00788-33/s1280x1920/10e93274c5f57feac01b3580af678a758a1507e7.jpg"
        alt=""
      />
    </div>
  );
}
